function onEachFeature(feature, layer) {
    // does this feature have a property named popupContent?
    if (feature.properties && feature.properties.Company_Name) {
        layer.bindPopup(feature.properties.Company_Name);
    }
    else if (feature.properties && feature.properties.OPERATOR) {
        layer.bindPopup(feature.properties.OPERATOR);
    }
}

var geojsonMarkerOptions = {
    radius: 8,
    fillColor: "#ff7800",
    color: "#000",
    weight: 1,
    opacity: 1,
    fillOpacity: 0.8
};

var geojsonMarkerOptions2 = {
    radius: 8,
    fillColor: "#007800",
    color: "#000",
    weight: 1,
    opacity: 1,
    fillOpacity: 0.8
};

L.geoJSON(AquacultureLicenses, {
       onEachFeature: function (feature, layer) {
        var content = `<h5>${feature.properties.OPERATOR}</h5>`;
        content += `<p>Aquaculture Licence</p><ul>
        <li>Location: ${feature.properties.SITE_LOCATION}</li>
        <li>Record Number: ${feature.properties.RECORD_NUMBER}</li>
        <li>Application Type: ${feature.properties.APPLICATION_TYPE}</li>
        <li>Operation Type: ${feature.properties.OPERATION_TYPE}</li>
        <li>Species: ${feature.properties.SPECIES}</li>
        </ul>`;
            layer.bindPopup(content);
       },
       pointToLayer: function (feature, latlng) {
               return L.circleMarker(latlng, geojsonMarkerOptions);
       }}
       ).addTo(mymap);


L.geoJSON(Processors, {
    onEachFeature: function (feature, layer) {
        var content = `<h5>${feature.properties.Company_Name}</h5>`;
        content += `<p>Processor</p><ul>
        <li>Location: ${feature.properties.Location}</li>
        <li>Licence Type: ${feature.properties.License_Type}</li>
        </ul>`;
         layer.bindPopup(content);
    },
    pointToLayer: function (feature, latlng) {
        return L.circleMarker(latlng, geojsonMarkerOptions2);
}}
).addTo(mymap);

/*Legend specific*/
var legend = L.control({ position: "topright"});

legend.onAdd = function(map) {
  var div = L.DomUtil.create("div", "legend");
  div.innerHTML += "<h4>Legend</h4>";
  div.innerHTML += '<i style="background: #FF7800"></i><span>2019 Licensed Aquaculture Sites</span><br>';
  div.innerHTML += '<i style="background: #007800"></i><span>2019 Licensed Processors</span><br>';

  div.innerHTML += '<a href="https://opendata.gov.nl.ca/public/opendata/page/?page-id=licence">The Open Government Licence -<br> Newfoundland and Labrador</a>.<br>';
  return div;
};

legend.addTo(mymap);

